/* @jsx mdx */
  import React from 'react'
  import { mdx } from '@mdx-js/react'
  /* @jsx mdx */
import { Playground, Props } from "docz";
import { Breadcrumb, BreadcrumbItem } from 'reactstrap';

const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h1 {...{
      "id": "breadcrumbs"
    }}>{`Breadcrumbs`}</h1>
    <p>{`A breadcrumb is a list of links to the parent pages of the current page in hierarchical order. It helps users find their place within a website or web application. Breadcrumbs are often placed horizontally before a page's main content.`}</p>
    <Playground __position={0} __code={'<Breadcrumb>\n  <BreadcrumbItem active>Home</BreadcrumbItem>\n</Breadcrumb>\n<Breadcrumb>\n  <BreadcrumbItem>\n    <a href=\"#\">Home</a>\n  </BreadcrumbItem>\n  <BreadcrumbItem active>Library</BreadcrumbItem>\n</Breadcrumb>\n<Breadcrumb>\n  <BreadcrumbItem>\n    <a href=\"#\">Home</a>\n  </BreadcrumbItem>\n  <BreadcrumbItem>\n    <a href=\"#\">Library</a>\n  </BreadcrumbItem>\n  <BreadcrumbItem active>Data</BreadcrumbItem>\n</Breadcrumb>'} __scope={{
      props: this ? this.props : props,
      Playground,
      Props,
      Breadcrumb,
      BreadcrumbItem
    }} mdxType="Playground">
    <Breadcrumb mdxType="Breadcrumb">
        <BreadcrumbItem active mdxType="BreadcrumbItem">Home</BreadcrumbItem>
    </Breadcrumb>
    <Breadcrumb mdxType="Breadcrumb">
        <BreadcrumbItem mdxType="BreadcrumbItem"><a href="#">Home</a></BreadcrumbItem>
        <BreadcrumbItem active mdxType="BreadcrumbItem">Library</BreadcrumbItem>
    </Breadcrumb>
    <Breadcrumb mdxType="Breadcrumb">
        <BreadcrumbItem mdxType="BreadcrumbItem"><a href="#">Home</a></BreadcrumbItem>
        <BreadcrumbItem mdxType="BreadcrumbItem"><a href="#">Library</a></BreadcrumbItem>
        <BreadcrumbItem active mdxType="BreadcrumbItem">Data</BreadcrumbItem>
    </Breadcrumb>
    </Playground>
    <pre><code parentName="pre" {...{}}>{`<nav class="navbar navbar-default " aria-label="breadcrumb">
    <ol class="breadcrumb bg-white">
        <li class="breadcrumb-item">
            <a class="text-decoration-none" href="#">Home</a>
        </li>
        <li class="breadcrumb-item text-decoration-none">
            <a class="text-decoration-none" href="#">Library</a>
        </li>
        <li class="breadcrumb-item active" aria-current="page">Data</li>
    </ol>
</nav>
`}</code></pre>
    <h3 {...{
      "id": "changing-the-separator"
    }}>{`Changing the Separator`}</h3>
    <p>{`Separators are automatically added in CSS through `}<inlineCode parentName="p">{`::before`}</inlineCode>{` and `}<inlineCode parentName="p">{`content`}</inlineCode>{`. They can be changed by changing `}<inlineCode parentName="p">{`$breadcrumb-divider`}</inlineCode>{`. The `}<inlineCode parentName="p">{`quote`}</inlineCode>{` function is needed to generate the quotes around a string, so if you want > as separator, you can use this:`}</p>
    <pre><code parentName="pre" {...{}}>{`\`$breadcrumb-divider: quote(">");\`
`}</code></pre>
    <p>{`Or by using CSS we can also do this and apply padding. Here's an example: `}</p>
    <pre><code parentName="pre" {...{}}>{`    .breadcrumb-item + .breadcrumb-item {
        padding-left: 0.5rem; 
    }
    .breadcrumb-item + .breadcrumb-item::before {
        display: inline-block;
        padding-right: 0.5rem;
        color: #747679;
        content: ">"; 
    }
`}</code></pre>
    <p>{`It’s also possible to use a base64 embedded SVG icon:`}</p>
    <pre><code parentName="pre" {...{}}>{`$breadcrumb-divider: url(data:image/svg+xml;base64,PHN2ZyB4bWxucz0iaHR0cDovL3d3dy53My5vcmcvMjAwMC9zdmciIHdpZHRoPSI4IiBoZWlnaHQ9IjgiPjxwYXRoIGQ9Ik0yLjUgMEwxIDEuNSAzLjUgNCAxIDYuNSAyLjUgOGw0LTQtNC00eiIgZmlsbD0iY3VycmVudENvbG9yIi8+PC9zdmc+);
`}</code></pre>
    <p>{`The separator can be removed by setting `}<inlineCode parentName="p">{`$breadcrumb-divider`}</inlineCode>{` to `}<inlineCode parentName="p">{`none`}</inlineCode>{`:`}</p>
    <pre><code parentName="pre" {...{}}>{`$breadcrumb-divider: none;
`}</code></pre>
    <h3 {...{
      "id": "assistive-technology"
    }}>{`Assistive Technology`}</h3>
    <p>{`  Since breadcrumbs provide a navigation, it’s a good idea to add a meaningful label such as `}<inlineCode parentName="p">{`aria-label="breadcrumb"`}</inlineCode>{` to describe the type of navigation provided in the `}<inlineCode parentName="p">{`<nav>`}</inlineCode>{` element, as well as applying an `}<inlineCode parentName="p">{`aria-current="page"`}</inlineCode>{` to the last item of the set to indicate that it represents the current page.`}</p>
    <p>{`  For more information, see the `}<a parentName="p" {...{
        "href": "https://www.w3.org/TR/wai-aria-practices/#breadcrumb",
        "target": "_blank",
        "rel": ["nofollow", "noopener", "noreferrer"]
      }}>{`WAI-ARIA Authoring Practices`}</a>{` for the breadcrumb pattern.`}</p>
    </MDXLayout>;
}

MDXContent.isMDXComponent = true;
